" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 509px\">",
"   <div class=\"ttl\">",
"    Progression of an intracerebral hemorrhage in an anticoagulated patient",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 489px; height: 296px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A 24-year-old woman with a prosthetic mitral valve presented to the emergency department with trouble speaking and headache that was suspected to be \"hysterical\" until a CT scan (Panel A) demonstrated an intracerebral hemorrhage (ICH) near Broca's area (arrow). The INR at this time was 3.2. She developed progressive weakness, stupor, and coma, with a repeat CT scan (Panel B) showing enlargement of the ICH (arrow). She died the next day from brain herniation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert G Hart, MD.",
"    </div>",
"   </div>",
"  </div>",
