var title_f17_8_17542="Surgical repair of parastomal hernia";
var content_f17_8_17542=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F67797&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F67797&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 520px\">",
"   <div class=\"ttl\">",
"    Surgical repair of parastomal hernia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 500px; height: 634px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Operative procedures used for repair of a parastomal hernia.",
"    <br>",
"     (A) Relocation of the stoma - high risk of failure.",
"     <br>",
"      (B) Direct repair of the fascial defect - high rate of recurrence.",
"      <br>",
"       (C) Subcutaneous mesh repair - low recurrence risk but undermining is a risk for ischemic injury to skin.",
"       <br>",
"        (D) Extraperitoneal mesh repair - most common approach for repair with lower failure rate.",
"        <div class=\"footnotes\">",
"        </div>",
"        <div class=\"reference\">",
"        </div>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
